import React from 'react';
import Movie from './Movie';

const Movies = (props) => {
    const {repos} = props;
    if (!repos || repos.length === 0) 
        return <p>No repos, sorry</p>;
    return (

      <React.Fragment>
      {
          repos.map((repo) => {
              return (
                  <Movie />
              )
          })
      }
      </React.Fragment>

    );
};

export default Movie;
